import { FormLabel, TextField } from '@mui/material';
import React from 'react'

const AddBook = () => {
  return (
    <form >
      <FormLabel>Name</FormLabel>
      <TextField margin="normal" fullWidth variant="outline" name="name" />
      <FormLabel>Author</FormLabel>
      <TextField margin="normal" fullWidth variant="outline" name="author" />
      <FormLabel>Description</FormLabel>
      <TextField margin="normal" fullWidth variant="outline" name="description" />
      <FormLabel>Price</FormLabel>
      <TextField margin="normal" fullWidth variant="outline" name="price" />

    </form>
  );
};

export default AddBook;
